contracts/transactionHandlers.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "../interfaces/Iparser.sol";

struct Transaction {
        bytes32 eventId;
        bytes32 transactionType;
        address Recorder;
        mapping(bytes32 => int256) params;
}

contract E00010001Processor{
    Transaction[] public transactions;
    IParser public Iparser;
    constructor(address _parser) {
        Iparser = IParser(_parser);
    }
    function processTransaction(bytes32[] calldata data) external {
        require(data.length == 6, "Data length for E00010001_2_3_7 must be 6"); 
        uint256 index = transactions.length;
        transactions.push();
        Transaction storage transaction = transactions[index];

        transaction.eventId = data[0];
        transaction.transactionType = data[1];
        transaction.Recorder = msg.sender;

        transaction.params[Iparser.stringToBytes32("EP001")] = int256(uint256(data[2]));
        transaction.params[Iparser.stringToBytes32("EP002")] = int256(uint256(data[3]));
        transaction.params[Iparser.stringToBytes32("EP003")] = int256(uint256(data[4]));
        transaction.params[Iparser.stringToBytes32("trans_time")] = int256(block.timestamp);
        transaction.params[Iparser.stringToBytes32("EP005")] = int256(uint256(data[5]));
    }
}

